import React from 'react';
import { IInfoBoxProps } from '../types/types';

const InfoBox = (props: IInfoBoxProps) => {
    const {
        faIcon,
    } = props
    return (
        <>
            <button className='infobox'>
                <i className={faIcon}>i</i>
            </button>
        </>
    )
}

export default InfoBox;
